    [],nt"revision_timestamp": "2015-12-20T19:03:40.561887",nt"name": "2011-south-carolina-dnr-lidar-tricounty-anderson-oconee-pickens",nt"isopen":
    false,nt"url": null,nt"notes": "Towill Inc. collected LiDAR for over 3,500
    square miles in York, Pickens, Anderson, and Oconee Counties in South Carolina.
    The nominal pulse spacing for this project was 1.4 meters. This project was collected
    with a sensor which collects waveform data and provides an intensity value for each
    discrete pulse extracted from the waveform. GPS Week Time, Intensity, Flightline
    and echo number attributes were provided for each LiDAR point. Dewberry used proprietary
    procedures to classify the LAS according to contract specifications: 1-Unclassified,
    2-Ground, 7-Noise, 8-Model Key Points, 9-Water, 10-Ignored Ground due to breakline
    proximity. Dewberry produced 3D breaklines and combined these with the final LiDAR
    data to produce seamless hydro flattened DEMs for the 677 tiles (5000 ft x 5000
    ft) that cover the project area. The report for Tricounty states: "A report covering
    the York County deliverable was also created and submitted separately." This report
    was delivered and can be found in the supplemental information for that mission
    on the Digital Coast (a link is provided below)",nt"license_title": null,nt"extras":
